import React, {FC, PropsWithChildren} from 'react';
import {AuthGuard} from "@entities/session";
import {Spinner} from "@shared/ui/spinner";

type UserGuardProps = PropsWithChildren<{
    isAuth: boolean;
    isUser: boolean;
}>;

export const UserGuard: FC<UserGuardProps> = (props) => {
    const {children, isAuth, isUser} = props;

    return (
        <AuthGuard isAuth={isAuth}>
            {isUser ? (
                <React.Fragment>{children}</React.Fragment>
            ) : (
                <Spinner />
            )}
        </AuthGuard>
    );
};
